import './App.css';
import React from 'react';
import RoutePage from './component/RoutePage';
import Header from './component/Header';


function App() {
  return (
    <React.Fragment>

        <Header/>
        <Router>

                <Switch>
                <Route path="/" exact component={ListUser}/>
                </Switch>

            </Router>


    </React.Fragment>

  );
}

export default App;
